import React from "react";
import ProjectCard from './ProjectCard';

const Projects = ({ projects }) => {

  return (
    <div className="main">
      <div className="projects">

        {projects.map(project => {
            return <ProjectCard project={project} key={project.id}/>
        })}
      </div>
    </div>
  );
};

export default Projects;
